insert  into `blogs`(`id`,`created_at`,`updated_at`,`title`,`img`,`desc`) values (3,'2022-03-25 22:05:26','2022-05-15 16:04:26','Life goes Faster','blog/Tcq81xAIGxS4d5MEZ6UCH2pWdHtNZdqOaI4mZA2l.webp','<p>\r\n\r\n\r\nLive in an era, where everything moves faster with time. Faster moves in every moment are like a blink of an eye. We move with time on this faster road. We are now in a competition to run beyond time.</p>'),(4,'2022-03-25 22:06:54','2022-05-15 16:04:41','A Colorful Sunrise','blog/7tg7dePB3DgWDamgHDOt7IQYmau4LbsBzFZktEdA.webp','<p>\r\nSunrises are definitely my favorite. I love the transformation that takes place in the world when the dark becomes light. I love the soft, yet vibrant colors of the sunrise. I love the gentle air of celebration at the arrival of the sun in the birds’ morning song.\r\nSo grabbing camera, I went to get a closer view of the sunrise this morning.\r\n</p>'),(5,'2022-03-27 21:15:27','2022-05-15 16:04:55','Growing with new Hope.','blog/lvZdHG56RfiyT5zGU3zo3IMBQ5h1BSwYsP4pb5AA.webp','<p>\r\nA life grows up with no hope but finds a way to live. It shows the power of rise alone. It’s about care own-self, Nurture own-self. Hope with high vision and inspiration found own-self in a new manner.    \r\n</p>'),(6,'2022-03-27 21:15:49','2022-05-15 16:05:08','A Gloomy Sunset','blog/HQaK3bM2ogNaiL7Mx60dhB8UvSfZpl6idXHHMqvv.webp','<p>\r\nThe sun has gone down from the sky and it is no longer in sight the moon is however and it is more beautiful than ever, it’s fullness is amazing I have never seen it so beautiful the light gently massages my face and the craters make me wonder what it would be like to live on the moon. The stars surrounding the moon are more wonderful than I can remember and they sparkle so beautifully shining in the sky like a beautiful diamond necklace making the moon stand out more than ever, this is the most amazing sight that I have ever seen I has been set in my mind forever. This is why I love the sunset because it is an amazing sight and then what follows afterwards is another breathtaking sight. Everything is so peaceful at night everything is calm and still\r\n</p>'),(7,'2022-03-27 21:16:05','2022-05-15 16:05:21','A crystal cave','blog/08RQlnCvme6zHFjvDsbUasT7bcEzIf7BB4IyGnGj.jpg','<p>\r\nNowadays, life is stuck inside a crystal cave. Dreamed here to shine and hope here to be one of the greatest. Sometimes life doesn\'t know the meaning of staying in a crystal cave. It always searches for hope and happiness.\r\n</p>'),(8,'2022-03-27 21:16:23','2022-05-15 16:05:37','Seeing the Sky','blog/dqaTharswz17pEGceVjBO9fhJf62BqEEhlJShuAm.webp','<p>\r\nAlways love watch an open sky. It is a better treatment for heart. It makes to heart so cheerful and satisfy the soul.\r\n\r\n</p>');

