','campaign/IO7BWCqLrCrUSQqiWnPvenwNMAICowOsy5KrlBTX.jpg','','','Call for Smartphone Photography Enthusiasts! \r\n\r\nছবির সাথে জরিয়ে থাকে আমাদের কত গল্প! তাই এই প্রথমবারের মতো ভিভো আয়োজন করেছে \"vivo Photography Chronicle\" যেখানে আপনি আপনার তোলা বেষ্ট ছবিটি শেয়ারের মাধ্যমে দেখাতে পারেন ফটোগ্রাফির প্রতি আপনার প্যাশন আর হতে পারেন ভিভো ম্যাগাজিনে ফিচার হওয়ার সুবর্ণ সুযোগ। এবারের ফটোগ্রাফি জার্নিতে আমাদের সাথে যুক্ত হচ্ছেন  Tahsan এবং সাথে আরও অনেক সারপ্রাইজ অপেক্ষা করছে শুধু আপনাদের জন্য! \r\nঅংশগ্রহণের শর্তাবলীঃ\r\n১. যেকোন স্মার্টফোনে তোলা আপনার প্রিয় ছবিটি শেয়ার করতে হবে।\r\n২. ছবিটি অবশ্যই ক্যাপশন অথবা গল্প লিখে শেয়ার করতে হবে।\r\n৩. ছবিটি #vivoPhotographyChronicle #vivoV30BD হ্যাশট্যাগসহ এই পোস্টে কমেন্ট করুন অথবা আমাদের vivo Moments ওয়েবসাইটে সাবমিট করুন। ছবি সাবমিট লিংকঃ \r\n https://vivomoments.com/campaign_detail/16\r\n৪. পোস্টটি আপনার প্রোফাইলে পাবলিকলি শেয়ার করুন হাশট্যাগসহ। \r\n\r\n\r\n**vivo যেকোন সময় এই নিয়ম ও শর্তাবলী পরিবর্তন, সংশোধন বা পরিপূরক করার অধিকার সংরক্ষণ করে**',2,NULL,'2024-03-04 09:19:06',NULL,'2024-03-04 15:18:55','2024-03-05 22:20:00');

