/*Table structure for table `photo_galleries` */

DROP TABLE IF EXISTS `photo_galleries`;

CREATE TABLE `photo_galleries` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `mobile_series_versions_id` int(11) DEFAULT NULL,
  `title` text COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `photo_caption` varchar(191) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `story` text COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `img` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `img_thumbnail` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `status` int(11) DEFAULT NULL,
  `users_id` int(11) NOT NULL,
  `campaign_id` bigint(20) unsigned DEFAULT NULL,
  `is_winner` tinyint(3) NOT NULL DEFAULT 0 COMMENT '1 - Yes, 0 - No',
  `is_photographer_image` tinyint(3) NOT NULL DEFAULT 0 COMMENT '1 - Yes, 0 - No',
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1497 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

